import logo from "./logo.svg";
import "./App.scss";
import { extendTheme, CssVarsProvider } from "@mui/joy/styles";
import { Button } from "@mui/joy";
import { useState, useEffect } from "react";
import PageOne from "./components/questions/PageOne";

const theme = extendTheme({
  colorSchemes: {

      palette: {
        primary: {
          50: '#C0CCD9',
          100: '#A5B8CF',
          200: '#6A96CA',
          300: '#4886D0',
          400: '#2178DD',
          500: '#096BDE',
          600: '#1B62B5',
          700: '#265995',
          800: '#2F4968',
          900: '#2F3C4C',
        },
      },
    },
});

function App() {
  //True is complete, False is incomplete
  const [quizStatus, setQuizStatus] = useState(
    !localStorage.getItem("quizStatus") === null ? true : false
  );
  const [quizStep, setQuizStep] = useState(null);

  const theme = createTheme({
    palette: {
      primary: {
        main: "#7391a1",
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <div>
        <header className="App-header"></header>
        <div className="p-[4rem] h-screen w-full flex flex-col justify-center items-center">
          <div className="absolute top-[3rem]">
            <div id="logo" className="flex flex-col items-center leading-10 ">
              <h1>NJITBytes</h1>
              <div>Healthier College Living</div>
            </div>
          </div>

          {quizStatus ? (
            "true"
          ) : quizStep == null ? (
            <Button
              variant="outlined"
              color="primary"
              bgColor="primary"
              onClick={() => {
                setQuizStep(0);
              }}
            >
              GET STARTED
            </Button>
          ) : (
            <PageOne />
          )}
        </div>

        <div
          id="footer"
          className="h-[8rem] bg-primary w-full absolute bottom-0 flex justify-center items-center"
        >
          <div className="text">HackNJIT 2023 - Team Phi Sig</div>
        </div>
      </div>
    </ThemeProvider>
  );
}

export default App;
